export function nologin() {
    function deletemessage(id) {
        fetch(`https://localhost:44317/api/Cseveges/delete?id=${id}`)
    }
    if (localStorage.getItem("user") == null) {
        window.location.href = "http://localhost:3000/Login"
    }
    var kezdo = localStorage.getItem("ujbeszelgetes")
    if (kezdo != null) {
        localStorage.removeItem("ujbeszelgetes")
    }
    alert("asd")
    fetch("https://localhost:44317/api/Cseveges")
        .then(response => {
            return response.json()
        })
        .then(data => {
            data.forEach(element => {
                if (element.Uzenet == "") {
                    deletemessage(element.Id)
                }
            });
        })
}
